import React from 'react';
import s from './Profile.module.css';
import MyPosts from "./MyPosts/MyPosts";
import ProfileData from "./ProfileData";

const Profile = (props) => {
    return (
        <div className={s.profilePage}>
            <div>

                <img src={props.state.posts.urlAvaFoto} className={s.fon} alt=''/>
            </div>

            <div className={s.userData}>
                <div>
                    <img src='https://i.ytimg.com/vi/ToNcTEAEUqo/maxresdefault.jpg' className={s.avatar} alt=''/>
                </div>
                <ProfileData userName={props.state.profiles.userName} birthDay={props.state.profiles.birthDay} city={props.state.profiles.city}
                             aducation={props.state.profiles.aducation} webSite={props.state.profiles.webSite}/>

            </div>

            <MyPosts state={props.state} addMessagePosts={props.addMessagePosts}/>
        </div>

    );
}

export default Profile
